package collectionframework;

import java.util.HashSet;

public class HashEx {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		HashSet<String> hs=new HashSet();
		hs.add("moulei");
		hs.add("subiksha");
		hs.add("bharathi");
		System.out.println("element in my hashset:"+hs);
		System.out.println("element in my hashset:"+hs.size());

	}

}
